import logo from './logo.svg';
import './App.css';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/home",
    element: <div>Hello world!</div>,
  },
]);

function App() {
  return (
    <div className="App">

      <RouterProvider router={router} />
    </div>
  );
}

export default App;
